tional logic in our %1$sdocumentation%2$s.'=>'قد تؤدي إضافة المنطق الشرطي على زر إرسال النموذج إلى حدوث مشكلات في قابلية الاستخدام لبعض المستخدمين ويؤثر سلبًا على إمكانية الوصول إلى النموذج الخاص بك. تعرف على المزيد حول المنطق الشرطي للأزرار في %1$sالوثائق%2$s.','User (ID: %d) Locale'=>'لغة المستخدم (المعرف: %d)','Site Locale'=>'لغة الموقع','Translations'=>'الترجمات','Once troubleshooting is complete, %1$sclick here to disable logging and permanently delete your log files.%2$s '=>'بمجرد اكتمال عملية استكشاف الأخطاء وإصلاحها، %1$sانقر هنا لتعطيل التسجيل وحذف ملفات السجل الخاصة بك بشكل دائم.%2$s ','Since logs may contain sensitive information, please ensure that you only leave it enabled for as long as it is needed for troubleshooting. '=>'نظرًا لأن السجلات قد تحتوي على معلومات حساسة، يرجى التأكد من تركها ممكّنة طالما كانت ضرورية لاستكشاف الأخطاء وإصلاحها. ','Gravity Forms logging is currently enabled. '=>'تسجيل Gravity Forms ممكّن الآن. ','Hiding the label can make it difficult for users to fill out your form. Please keep the label visible to improve the accessibility of your form.'=>'قد يؤدي إخفاء التسمية إلى صعوبة قيام المستخدمين بملء النموذج الخاص بك. يرجى إبقاء التسمية مرئية لتحسين إمكانية الوصول إلى النموذج الخاص بك.','The datepicker is not accessible for users who rely on the keyboard or screen reader. Please select a different input type to improve the accessibility of your form.'=>'لا يمكن الوصول إلى منتقي التاريخ للمستخدمين الذين يعتمدون على لوحة المفاتيح أو قارئ الشاشة. الرجاء تحديد نوع إدخال مختلف لتحسين إمكانية الوصول إلى النموذج الخاص بك.','jump to this field\'s settings'=>'انتقل إلى إعدادات هذا الحقل','delete this field'=>'احذف هذا الحقل','duplicate this field'=>'كرر هذا الحقل','Max. files: %s'=>'الحد الأقصى للملفات: %s','Max. file size: %s'=>'الحد الأقصى لحجم الملف: %s','{field_label} - {field_type}, jump to this field\'s settings'=>'{field_label} - {field_type}، انتقل إلى إعدادات هذا الحقل','This form has legacy markup enabled and doesn’t support field resizing within the editor. Please disable legacy markup in the form settings to enable live resizing.'=>'تم تمكين العلامات القديمة في هذا النموذج ولا يدعم تغيير حجم الحقل داخل المحرر. يرجى تعطيل العلامات القديمة في إعدادات النموذج لتمكين تغيير الحجم المباشر.','is no longer necessary.'=>'لم يعد ضروريا.','Search for form'=>'ابحث عن نموذج','Search forms'=>'ابحث عن النماذج','Select a different form'=>'حدد نموذجًا مختلفًا','Click the file selection button to upload a Gravity Forms export file from your computer. Please make sure your file has the .json extension, and that it was generated by the Gravity Forms Export tool.'=>'انقر زر تحديد الملف لرفع ملف تصدير Gravity Forms من جهاز الكمبيوتر الخاص بك. يرجى التأكد من أن الملف الخاص بك يحتوي على الامتداد .json وأنه تم إنشاؤه بواسطة أداة Gravity Forms Export.','Learn More'=>'أعرف أكثر','Working with Columns in the Form Editor in Gravity Forms 2.5'=>'يعمل مع الأعمدة في محرر النماذج في Gravity Forms 2.5','This form uses deprecated Ready Classes. Adding columns is easier than ever with the new Drag and Drop Layout Editor.'=>'يستخدم هذا النموذج فئات جاهزة مهجورة. أصبحت إضافة الأعمدة أسهل من أي وقت مضى باستخدام محرر تخطيط السحب والإسقاط الجديد.','Select the Gravity Forms export files you would like to import. Please make sure your files have the .json extension, and that they were generated by the %sGravity Forms Export form%s tool. When you click the import button below, Gravity Forms will import the forms.'=>'حدد ملفات تصدير Gravity Forms التي ترغب في استيرادها. يرجى التأكد من أن ملفاتك لها الامتداد .json وأنه تم إنشاؤها بواسطة أداة نموذج %sGravity Forms Export %s. عند النقر على زر الاستيراد أدناه، ستقوم Gravity Forms باستيراد النماذج.','Forms could not be imported. Please make sure your files have the .json extension, and that they were generated by the %sGravity Forms Export form%s tool.'=>'لا يمكن استيراد النماذج. يرجى التأكد من أن ملفاتك لها الامتداد .json وأنه تم إنشاؤها بواسطة أداة نموذج %sGravity Forms Export%s.','The