البيانات" (ضمن قسم قاعدة البيانات) لإنشاء الجدول المفقود.','Update Settings'=>'تحديث الاعدادات','The email address entered is invalid, please check the formatting (e.g. email@domain.com).'=>'عنوان البريد الإلكتروني الذي تم إدخاله غير صالح، يرجى التحقق من التنسيق (على سبيل المثال، email@domain.com).','Please complete the following fields: %s.'=>'الرجاء إكمال الحقول التالية: %s.','Select and display one of your forms.'=>'حدد واعرض أحد النماذج الخاصة بك.','You are about to move this form to the trash. \'Cancel\' to stop, \'OK\' to move to trash.'=>'أنت على وشك نقل هذا النموذج إلى سلة المهملات. "إلغاء" للتوقف، و"موافق" للانتقال إلى سلة المهملات.','remove this rule'=>'إزالة هذه القاعدة','add another rule'=>'إضافة قاعدة أخرى','Conditional logic allows you to change what the user sees depending on the fields they select.'=>'يسمح لك المنطق الشرطي بتغيير ما يراه المستخدم اعتمادًا على الحقول التي يحددها.','Column'=>'عمود','Drag a field to the left to start building your form and then start configuring it.'=>'اسحب حقلاً إلى اليسار لبدء إنشاء النموذج الخاص بك ثم ابدأ في تكوينه.','Simply drag and drop the fields or elements you want in this form.'=>'ما عليك سوى سحب وإسقاط الحقول أو العناصر التي تريدها في هذا النموذج.','Return to form list'=>'العودة إلى قائمة النموذج','Full Width'=>'كامل العرض','Display Mode'=>'وضع العرض','Discover the Gravity Forms API'=>'اكتشف واجهة برمجة تطبيقات (API) Gravity Forms','Search Our Documentation'=>'ابحث في الوثائق الخاصة بنا','Please review the %sdocumentation%s first. If you still can\'t find the answer %sopen a support ticket%s and we will be happy to answer your questions and assist you with any problems.'=>'يرجى مراجعة %sالوثائق%s أولاً. إذا كنت لا تزال غير قادر على العثور على الإجابة %sافتح تذكرة دعم%s وسنكون سعداء بالإجابة على أسئلتك ومساعدتك في حل أية مشكلات.','How can we help you?'=>'كيف يمكننا مساعدتك؟','Move'=>'نقل','The %s table does not exist.'=>'الجدول %s غير موجود.','%s uninstalled. It can be re-activated from the %splugins page%s.'=