 بتحديد خيار واحد من قائمة ما.','Allows users to upload a file.'=>'يسمح للمستخدمين برفع ملف.','Allows users to submit a single line of text.'=>'يسمح للمستخدمين بإرسال سطر واحد من النص.','Adds a content separator to your form to help organize groups of fields. This is a visual element and does not collect any data.'=>'يضيف فاصل محتوى إلى النموذج الخاص بك للمساعدة في تنظيم مجموعات الحقول. هذا عنصر مرئي ولا يجمع أي بيانات.','Allows users to enter a physical address.'=>'يسمح للمستخدمين بإدخال عنوان فعلي.','Allows users to enter their name in the format you have specified.'=>'يسمح للمستخدمين بإدخال أسمائهم بالصغة التي حَددتها.','Allows users to select multiple options available in the multi select box.'=>'يسمح للمستخدمين بتحديد خيارات متعددة متاحة في مربع التحديد المتعدد.','Allows users to enter a date.'=>'يسمح للمستخدمين بإدخال التاريخ.','Allows users to submit a time as hours and minutes.'=>'يسمح للمستخدمين بإرسال الوقت بالساعات والدقائق.','Allows users to submit data that is then used as the excerpt of a post.'=>'يسمح للمستخدمين بإرسال البيانات التي يتم استخدامها بعد ذلك كمقتطف من المقالة.','Allows the user to enter a password and confirm it.  The password will be masked with blobs or asterisks.'=>'يسمح للمستخدم بإدخال كلمة المرور وتأكيدها. سيتم إخفاء كلمة المرور باستخدام النقط أو العلامات النجمية.','Allows users to submit data that is used as a custom field value for a post.'=>'يسمح للمستخدمين بإرسال البيانات التي يتم استخدامها كقيمة حقل مخصصة للمقالة.','Allows users to enter a number.'=>'يسمح للمستخدمين بإدخال رقم.','Allows users to submit the title for a post.'=>'يسمح للمستخدمين بإرسال عنوان للمقالة.','Allows the creation of products in the form.'=>'يسمح بإنشاء المنتجات في النموذج.','Allows the user to select a category for the post they are creating.'=>'يسمح للمستخدم بتحديد تصنيف للمقالة الذي يقومون بإنشائه.','Allows users to enter credit card information.'=>'يسمح للمستخدمين بإدخال معلومات بطاقة الائتمان.','Allows users to enter a website URL.'=>'يسمح للمستخدمين بإدخال عنوان موقع إلكتروني URL.','Allows users to enter a phone number.'=>'يسمح للمستخدمين بإدخال رقم الهاتف.','Stores information that should not be visible to the user but can be processed and saved with the user submission.'=>'يخزن المعلومات التي لا ينبغي أن تكون مرئية للمستخدم ولكن يمكن معالجتها وحفظها مع إرسال المستخدم.','Allows a quantity to be specified for product field.'=>'يسمح بتحديد كمية لحقل المنتج.','Allows users to select one or many checkboxes.'=>'يسمح للمستخدمين بتحديد مربع اختيار واحد أو أكثر.','This field has errors.'=>'هذا الحقل به أخطاء.','An empty label violates %1$sWCAG%2$s. Please use descriptive text for your label. To hide the label, use the "Field Label Visibility" setting.'=>'التصنيف الفارغ يُنتهك %1$sWCAG%2$s. الرجاء استخدام نص وصفي لتسمياتك. لإخفاء التسمية، استخدم الإعداد "رؤية تسمية الحقل".','To better comply with %1$sWCAG%2$s, we use the placeholder or description as a hidden label for screen readers.'=>'للامتثال بشكل أفضل لـ %1$sWCAG%2$s، نستخدم العنصر النائب أو الوصف كتسمية مخفية لقارئات الشاشة.','Minute'=>'الدقيقة','Hour'=>'الساعة','MM'=>'الشهر','This operation deletes ALL Gravity Forms settings. If you continue, you will NOT be able to retrieve these settings.'=>'تؤدي هذه العملية إلى حذف جميع إعدادات Gravity Forms. إذا واصلت، فلن تتمكن من استرداد هذه الإعدادات.','{0} of the following match:'=>'{0} من التطابق التالي:','Disable'=>'تعطيل','Provide a title and a description for this form'=>'توفير عنوان ووصف لهذا النموذج','Resend'=>'إعادة إرسال','Print entry'=>'طباعة الإدخال','Please review the fields below.'=>'يرجى مراجعة الحقول أدناه.','End date'=>'تاريخ الإنتهاء','Start date'=>'تاريخ البدء','Include results if'=>'تضمين النتائج إذا','You must have at least one form to use the block.'=>'يجب أن يكون لديك نموذج واحد على الأقل لاستخدام المكون.','The selected form has been deleted or trashed. Please select a new form.'=>'تم حذف النموذج المحدد أو نقله إلى سلّة المهملات. الرجاء تحديد نموذج جديد.','Tabindex'=>'علامات تبويب الفهرس (Tabindex)','Field Values'=>'قيم الحقل','AJAX'=>'AJAX','Remove Custom Value'=>'إزالة القيمة المخصصة','This field has accessibility issues.'=>'يحتوي هذا الحقل على مشكلات إمكانية الوصول.','The Enhanced User Interface is not accessible for screen reader users and people who cannot use a mouse.'=>'لا يمكن لمستخدمي قارئ الشاشة والأشخاص الذين لا يستطيعون استخدام الماوس الوصول إلى واجهة المستخدم المحسنة.','Users can enter a date in the field without using the date picker. Display the date format so they know what is the specified format.'=>'يمكن للمستخدمين إدخال تاريخ في الحقل دون استخدام منتقي التاريخ. قم بعرض صيغة التاريخ حتى يعرفوا ما هو الصيغة المحددة.','The Multi Select field type is hard to use for people who cannot use a mouse. Please select a different field type to improve the accessibility of your form.'=>'يصعب استخدام نوع حقل التحديد المتعدد للأشخاص الذين لا يستطيعون استخدام الماوس. الرجاء تحديد نوع حقل مختلف لتحسين إمكانية الوصول إلى النموذج الخاص بك.','Select a field'=>'حدد حقلاً','Delete choice'=>'حذف الإختيار','Add choice'=>'إضافة الإختيار','You must add a Product field to the form first.'=>'يجب عليك إضافة حقل المنتج إلى النموذج أولاً.','Rev.'=>'القس','Prof.'=>'الأستاذ','Dr.'=>'الدكتور','Ms.'=>'السيد','Miss'=>'الآنسة','Mrs.'=>'السيدة','Mr.'=>'السيد.','AM/PM'=>'صباحا/مساء','YYYY'=>'السنة','DD'=>'اليوم','Enter consent agreement text here.  The Consent Field will store this agreement text with the form entry in order to track what the user has consented to.'=>'أدخل نص اتفاقية القبول هنا. سيقوم حقل القبول بتخزين نص الاتفاقية هذا مع إدخال النموذج لتتبع ما وافق عليه المستخدم.','I agree to the privacy policy.'=>'أوافق على سياسة الخصوصية.','Donation'=>'تبرع','Third Option'=>'الخيار الثالث','Second Option'=>'الخيار الثانى','First Option'=>'الخيار الاول','Product Name'=>'اسم المنتج','Post Custom Field'=>'حقل منشورة مخصص','Post Tags'=>'وسوم المقال','Post Excerpt'=>'الوصف المختصر للمقال','Post Body'=>'محتوى المقال','Post Title'=>'عنوان المقالة','Hidden Field'=>'حقل مخفى','Card Type'=>'نوع البطاقه','State / Province'=>'الولاية / المنطقة','Third Choice'=>'الخيار الثالث','Second Choice'=>'الخيار الثانى','First Choice'=>'الخيار الاول','Untitled'=>'غير معنون','HTML Block'=>'مربع HTML','Section Break'=>'قسم جديد','This form has an Option field without a Product field. You must add a Product field to your form.'=>'يحتوي هذا النموذج على حقل خيار بدون حقل منتج. يجب عليك إضافة حقل منتج إلى النموذج الخاص بك.','This form currently has one or more pages without any fields. Blank pages are a result of Page Breaks that are positioned as the first or last field in the form or right after each other. Please adjust the Page Breaks.'=>'يحتوي هذا النموذج حاليًا على صفحة واحدة أو أكثر بدون أي حقول. الصفحات الفارغة هي نتيجة لفواصل الصفحات التي يتم وضعها في الحقل الأول أو الأخير في النموذج أو مباشرة بعد بعضها البعض. يرجى ضبط فواصل الصفحات.','Please enter a Title for this form. When adding the form to a page or post, you will have the option to hide the title.'=>'الرجاء إدخال عنوان لهذا النموذج. عند إضافة النموذج إلى صفحة أو مقالة، سيكون لديك خيار إخفاء العنوان.','Column 3'=>'عامود ٣','Column 2'=>'عامود ٢','Column 1'=>'عامود ١','Deleted Field'=>'حقل محذوف','This field is not associated with a product. Please add a Product Field to the form.'=>'هذا الحقل غير مرتبط بمنتج. الرجاء إضافة حقل المنتج إلى النموذج.','Same as previous'=>'كالسابق','Custom Sub-Label'=>'حقل ثانوي مخصص','Sub-Label:'=>'عنوان ثانوي:','Autocomplete Attribute:'=>'سمة الإكمال التلقائي:','Placeholder:'=>'عنصر نائب:','Default Value:'=>'القيمة الافتراضية:','Parameter Name'=>'اسم المُعامل','Parameter Name:'=>'اسم المُعامل:','Select a category'=>'اختار تصنيف','Completed'=>'اكتمل','To use conditional logic, please create a field that supports conditional logic.'=>'لاستخدام المنطق الشرطي، يرجى إنشاء حقل يدعم المنطق الشرطي.','Item has been saved.'=>'تم تسجيل العنصر','This custom choice name is already in use. Please enter another name.'=>'اسم الاختيار المخصص هذا قيد الاستخدام بالفعل. الرجاء إدخال اسم آخر.','Item has been deleted.'=>'تم حذف العنصر','Inactive Columns'=>'العواميد الغير مفعلة','Active Columns'=>'العواميد المفعلة','Oops! We could not locate your form. Please try again.'=>'عفوا! لم نتمكن من تحديد موقع النموذج الخاص بك. يرجى المحاولة مرة اخرى.','reCAPTCHA'=>'reCAPTCHA','Please complete the reCAPTCHA widget to validate your reCAPTCHA keys:'=>'الرجاء إكمال ودجت reCAPTCHA للتحقق من صحة مفاتيح reCAPTCHA الخاصة بك:','reCAPTCHA keys are invalid.'=>'مفاتيح reCAPTCHA غير صالحة.','Validate Keys'=>'التحقق من المفاتيح','Invisible'=>'غير مرئى','Secret Key'=>'المفتاح السري','Site Key'=>'موقع المفتاح','These settings are required only if you decide to use the reCAPTCHA field.'=>'هذه الإعدادات مطلوبة فقط إذا قررت استخدام حقل reCAPTCHA.','Please note, only v2 keys are supported and checkbox keys are not compatible with invisible reCAPTCHA.'=>'يرجى الإنتباه، أن مفاتيح v2 فقط هي المدعومة وأن مفاتيح مربع الاختيار غير متوافقة مع reCAPTCHA الغير المرئي.','Gravity Forms integrates with reCAPTCHA, a free CAPTCHA service that uses an advanced risk analysis engine and adaptive challenges to keep automated software from engaging in abusive activities on your site. '=>'يتكامل Gravity Forms مع reCAPTCHA. خدمة CAPTCHA مجانية تستخدم محركًا متقدمًا لتحليل المخاطر وتحديات تكيفية لمنع البرامج الآلية من الانخراط في أنشطة مسيئة على موقعك. ','reCAPTCHA Settings'=>'اعدادات reCAPTCHA','Settings: General'=>'الإعدادات: عام','Enable Akismet Integration'=>'تمكين تكامل Akismet','Enable to prevent extraneous scripts and styles from being printed on a Gravity Forms admin pages, reducing conflicts with other plugins and themes.'=>'تمكين لمنع طباعة النصوص والتنسيقات الدخيلة على صفحات إدارة Gravity Forms، مما يقلل التعارضات مع الإضافات الأخرى والقوالب.','No Conflict Mode'=>'لا يوجد وضع نزاع','Enable Automatic Background Updates'=>'تمكين تحديثات الخلفية التلقائية','Enable to allow Gravity Forms to download and install bug fixes and security updates automatically in the background. Requires a valid license key.'=>'تمكين للسماح لـ Gravity Forms بتنزيل وتنصيب إصلاحات الأخطاء والتحديثات الأمنية تلقائيًا في الخلفية. يتطلب مفتاح ترخيص صالح.','Automatic Background Updates'=>'تحديثات الخلفية التلقائية','Enable Toolbar Menu'=>'تمكين قائمة شريط الأدوات','Enable to display the forms menu in the WordPress top toolbar. The forms menu will display the ten forms recently opened in the form editor.'=>'تمكين قائمة النماذج لعرضها في شريط أدوات ووردبريس العلوي. ستعرض قائمة النماذج النماذج العشرة التي تم فتحها مؤخرًا في محرر النماذج.','Enable Logging'=>'تمكين التسجيل','Enable if you would like logging within Gravity Forms. Logging allows you to easily debug the inner workings of Gravity Forms to solve any possible issues. '=>'قم بالتمكين إذا كنت ترغب في التسجيل في Gravity Forms. يتيح لك التسجيل تصحيح أخطاء العمل الداخلي لـ Gravity Forms بسهولة لحل أي مشكلات محتملة. ','Logging'=>'يتم التسجيل','Select the default currency for your forms. This is used for product fields, credit card fields and others.'=>'حدد العملة الافتراضية للنماذج الخاصة بك. يستخدم هذا لحقول المنتج وحقول بطاقة الائتمان وغيرها.','Default Currency'=>'العملة الافتراضية','Disable CSS'=>'تعطيل CSS','Output Default CSS'=>'إخراج CSS الافتراضي','Paste Your License Key Here'=>'الصق مفتاح الترخيص الخاص بك هنا','A valid license key is required for access to automatic plugin upgrades and product support.'=>'مطلوب مفتاح ترخيص صالح للوصول إلى ترقيات الإضافة التلقائية ودعم المنتج.','Support License Key'=>'دعم مفتاح الترخيص','Your license key has been successfully validated. '=>'لقد تم التحقق من صحة مفتاح الترخيص الخاص بك بنجاح. ','Warning! ALL Gravity Forms data, including form entries will be deleted. This cannot be undone. \'OK\' to delete, \'Cancel\' to stop'=>'تحذير! سيتم حذف جميع بيانات Gravity Forms بما في ذلك إدخالات النموذج. لا يمكن التراجع عنها. "موافق" للحذف، و"إلغاء" للإيقاف','Gravity Forms has been successfully uninstalled. It can be re-activated from the %splugins page%s.'=>'تم إلغاء تثبيت Gravity Forms بنجاح. يمكن إعادة تنشيطه من %sصفحة الإضافات%s.','You don\'t have adequate permission to uninstall Gravity Forms.'=>'ليس لديك الصلاحية الكافية لإلغاء تثبيت Gravity Forms.','Select the visibility for this field.'=>'حدد إمكانية الرؤية لهذا الحقل.','The field is only visible when administering submitted entries. The field is not visible or functional when viewing the form.'=>'يكون الحقل مرئيًا فقط عند إدارة الإدخالات المقدمة. الحقل غير مرئي أو غير وظيفي عند عرض النموذج.','Administrative'=>'إداري','The field is hidden when viewing the form. Useful when you require the functionality of this field but do not want the user to be able to see this field.'=>'يتم إخفاء الحقل عند عرض النموذج. يكون هذا مفيدًا عندما تحتاج إلى وظيفة هذا الحقل ولكنك لا تريد أن يتمكن المستخدم من رؤية هذا الحقل.','Default option. The field is visible when viewing the form.'=>'الخيار الافتراضي. يكون الحقل مرئيًا عند عرض النموذج.','Visible'=>'عرض','Cancel this upload'=>'الغاء هذا الرفع','Please wait for the uploading to complete'=>'من فضلك انتظر اكتمال الرفع','There was a problem while saving the file on the server'=>'حدثت مشكلة أثناء حفظ الملف على الخادم','Maximum number of files reached'=>'تم الوصول إلى الحد الأقصى لعدد الملفات','This type of file is not allowed.'=>'هذا النوع من الملفات غير مسموح به.','File exceeds size limit'=>'الملف يتخطى الحجم الاقصى','in progress'=>'جارى','Delete this file'=>'احذف هذا الملف','This type of file is not allowed. Must be one of the following: '=>'نوع الملف التالى . لابد ان يكون من التالى: ','Voided'=>'باطلة','Refunded'=>'تم استعادة المبلغ المالي','Cancelled'=>'تم الالغاء','Failed'=>'فشل','Processing'=>'جاري التنفيذ','Paid'=>'مدفوعه','Authorized'=>'مُصرح له','Transaction ID'=>'معرف المعاملة','Source URL'=>'رابط المصدر','Starred'=>'مفضلة','Any form field'=>'جميع حقول النموذج','Predefined Choices'=>'اختيارات محددة مسبقًا','Custom Choices'=>'اختيارات مخصصة','Remove a condition'=>'حذف شرط','Add a condition'=>'أضف شرطًا','This form contains conditional logic dependent upon this choice. Are you sure you want to modify this choice? \'Cancel\' to abort. \'OK\' to continue.'=>'يحتوي هذا النموذج على شرط منطقي يعتمد على هذا الاختيار. هل أنت متأكد من أنك تريد تعديل هذا الاختيار؟ اضغط على "إلغاء" لايقاف الاختيار. اضغط على "موافق" للمتابعة.','This form contains conditional logic dependent upon this choice. Are you sure you want to delete this choice? \'Cancel\' to abort. \'OK\' to delete.'=>'يحتوي هذا النموذج على شرط منطقي يعتمد على هذا الاختيار. هل أنت متأكد من أنك تريد حذف هذا الاختيار؟ انقر فوق "إلغاء" لايقاف الاختيار. انقر فوق "موافق" لحذفه.','This form contains conditional logic dependent upon this field. Deleting this field will deactivate those conditional logic rules and also delete all entry data associated with the field. \'Cancel\' to abort. \'OK\' to delete.'=>'يحتوي هذا النموذج على شرط منطقي يعتمد على هذا الحقل. سيؤدي حذف هذا الحقل إلى تعطيل قواعد الشرط المنطقي هذه وحذف جميع بيانات الإدخال المرتبطة بالحقل. انقر فوق "إلغاء" لايقاف العملية. انقر فوق "موافق" لحذفها.','Deleting this field will also delete all entry data associated with it. \'Cancel\' to abort. \'OK\' to delete.'=>'سيؤدي حذف هذا الحقل إلى حذف جميع بيانات الإدخال المرتبطة به أيضًا. انقر فوق "إلغاء" للايقاف انقر فوق "موافق" للحذف.','Please enter a confirmation name.'=>'من فضلك ادخل اسم التاكيد.','Please enter a URL.'=>'من فضلك ادخل الرابط.','Please select a page.'=>'يرجى اختار صفحة.','Untitled Confirmation'=>'تاكيد بدون عنوان','There are unsaved changes to the current confirmation. Would you like to discard these changes?'=>'توجد تغييرات غير محفوظة على التأكيد الحالي. هل ترغب في تجاهل هذه التغييرات؟','Are you sure you wish to delete this confirmation?'=>'هل أنت متأكد أنك ترغب في حذف هذا التأكيد؟','There was an issue saving this confirmation.'=>'حدثت مشكلة أثناء حفظ هذا التأكيد.','Are you sure you wish to cancel these changes?'=>'هل أنت متأكد من رغبتك في إلغاء هذه التغييرات؟','Saving...'=>'يتم الحفظ...','Send this notification if'=>'أرسل هذا الإشعار إذا','Use this confirmation if'=>'استخدم هذا التاكيد اذا','Empty (no choices selected)'=>'فارغ (لم يتم تحديد أي اختيارات)','of the following match:'=>'من التطابق التالي:','Conditional LogicAny'=>'أي','Conditional LogicAll'=>'الكل','Hide'=>'إخفاء','Show'=>'عرض','this form button if'=>'هذا النموذج إذا','this section if'=>'هذا القسم إذا','this field if'=>'هذا الحقل اذا','We would love to hear from you! Please fill out this form and we will get in touch with you shortly.'=>'كنا نحب أن نسمع منك! يرجى ملء هذا النموذج وسنتواصل معك قريبًا.','Untitled Form'=>'نموذج غير معنون','Enter a value'=>'ادخل قيمة','5 of %d items shown. Edit field to view all'=>'تم عرض 5 من %d من العناصر. حرر الحقل لعرض الكل','Select a format'=>'اختر صيغة','The form has been saved.  The content contains the link to return and complete the form.'=>'تم حفظ النموذج. يحتوي المحتوى على الرابط للعودة واستكمال النموذج.','Row removed'=>'تمت إزالة الصف','New row added.'=>'تمت إضافة صف جديد.','Pricing fields are not editable'=>'حقول التسعير غير قابلة للتحرير','%1$s at %2$s'=>'%1$s في %2$s','%s ago'=>'%s مضى','Gravity Forms requires WordPress %s or greater. You must upgrade WordPress in order to use Gravity Forms'=>'Gravity Forms يتطلب ووردبريس %s أو أحدث. يجب عليك ترقية ووردبريس لتتمكن من استخدام Gravity Forms','Cannot send email because the FROM address is invalid.'=>'لا يمكن إرسال البريد الإلكتروني لأن العنوان غير صالح.','Cannot send email because there is no SUBJECT and no MESSAGE.'=>'لا يمكن إرسال بريد إلكتروني لأنه لا يوجد موضوع ولا رسالة.','Cannot send email because the TO address is invalid.'=>'لا يمكن إرسال البريد الإلكتروني لأن عنوان "إلى" غير صالح.','Allowable form fields'=>'Allowable form fields','Full Size - Right Aligned'=>'Full Size - Right Aligned','Full Size - Centered'=>'الحجم الكامل - فى الوسط','Full Size - Left Aligned'=>'الحجم الكامل - جهة الشمال','Full Size'=>'الحجم الكامل','Large - Right Aligned'=>'الصورة الكبيرة  - جهة اليمين','Large - Centered'=>'الصورة الكبيرة  - فى الوسط','Large - Left Aligned'=>'الصورة الكبيرة  - جهة الشمال','Medium - Right Aligned'=>'الصورة المتوسط - جهة اليمين','Medium - Centered'=>'الصورة المتوسط - فى الوسط','Medium - Left Aligned'=>'الصورة المتوسط - جهة اليسار','Thumbnail - Right Aligned'=>'الصورة المصغرة  - جهة اليمين','Thumbnail - Centered'=>'الصورة المصغرة - فى الوسط','Thumbnail - Left Aligned'=>'الصورة المصغره - جهة اليسار','Thumbnail'=>'الصور المصغره','Select image size'=>'اختار حجم الصورة','Pricing form fields'=>'حقول نموذج التسعير','Optional form fields'=>'حقول النموذج الاختيارية','Required form fields'=>'حقول النموذج المطلوبة','Post Edit URL'=>'رابط تعديل المقالات','Form Id'=>'رقم النموذج','Entry URL'=>'رابط المدخلة','All Pricing Fields'=>'جميع حقول السعر','All Submitted Fields'=>'جميع الحقول المُرسلة','Forms per page:'=>'النماذج لكل صفحة:','Select an action for this shortcode. Actions are added by some add-ons.'=>'حدد إجراءً لهذا الكود القصير. تتم إضافة الإجراءات بواسطة بعض الإضافات.','Select an action'=>'اختر إجراء','Specify the starting tab index for the fields of this form.'=>'حدد فهرس علامة تبويب البداية لحقول هذا النموذج.','Specify whether or not to use Ajax to submit the form.'=>'حدد ما إذا كنت تريد استخدام Ajax لإرسال النموذج أم لا.','Whether or not to display the form description.'=>'ما إذا كان سيتم عرض وصف النموذج أم لا.','Whether or not to display the form title.'=>'ما إذا كان سيتم عرض عنوان النموذج أم لا.','Can\'t find your form? Make sure it is active.'=>'لا يمكن العثور على النموذج الخاص بك؟ تأكد من أنه مفعل.','Select a form from the list to add it to your post or page.'=>'حدد نموذجًا من القائمة لإضافته إلى مقالتك أو صفحتك.','Select a form below to add it to your post or page.'=>'حدد نموذجًا أدناه لإضافته إلى مقالتك أو صفحتك.','All Forms'=>'كل النماذج','Recent'=>'حديث','Preview this form'=>'معاينة هذا النموذج','Editor'=>'محرر','Oops! There was an error saving the form title. Please refresh the page and try again.'=>'عذرًا! حدث خطأ أثناء حفظ عنوان النموذج. يرجى تحديث الصفحة وحاول مرة أخرى.','The %sSend To%s email address provided is not valid.'=>'عنوان البريد الإلكتروني%sأرسل إلى%s المُقدم غير صالح.','No notifications have been selected. Please select a notification to be sent.'=>'لم يتم اختيار أي إشعارات. الرجاء تحديد إشعار ليتم إرساله.','There was an error while resending the notifications.'=>'حدث خطأ أثناء إعادة إرسال الإشعارات.','Add-On browser is currently unavailable. Please try again later.'=>'متصفح الإضافية غير متاح حاليًا. الرجاء إعادة المحاولة في وقت لاحق.','Finished'=>'انتهى','Unable to disable logging.'=>'غير قادر على تعطيل التسجيل.','Logging disabled.'=>'تم تعطيل التسجيل.','Failed to load the preview for this form.'=>'فشل تحميل المعاينة لهذا النموذج.','Please select a form.'=>'يُرجى اختار نموذج.','Dismiss'=>'تجاهُل','There is an update available for Gravity Forms. %sView Details%s'=>'يتوفر تحديث لـ Gravity Forms. %sعرض التفاصيل%s','You don\'t have any forms. Let\'s go %screate one %s!'=>'ليس لديك أي نموذج. هيا بنا %sننشأ واحدًا %s!','View All Forms'=>'شاهد جميع النماذج','View All Entries'=>'شاهد جميع المدخلات','Last Entry: %s'=>'الإدخال الأخير: %s','Unread'=>'غير مقروء','Oops!! Something went wrong. %sPlease try again or %scontact us%s.'=>'عذرًا!! حدث خطأ ما. %sالرجاء المحاولة مرة أخرى أو %sاتصل بنا%s.','The versions of the following add-ons you\'re running haven\'t been tested with Gravity Forms %s. Please update them or confirm compatibility before updating Gravity Forms, or you may experience issues:'=>'لم يتم اختبار إصدارات الإضافاة التالية التي تقوم بتشغيلها باستخدام Gravity Forms %s. يرجى تحديثها أو تأكيد التوافق قبل تحديث Gravity Forms، وإلا قد تواجه مشكلات:','IMPORTANT: As this is a major update, we strongly recommend creating a backup of your site before updating.'=>'هام: نظرًا لأن هذا التحديث رئيسي، فإننا نوصي بشدة بإنشاء نسخة احتياطية لموقعك قبل التحديث.','%1$sRegister%2$s your copy of Gravity Forms to receive access to automatic upgrades and support. Need a license key? %3$sPurchase one now%4$s. '=>'%1$sسجل%2$s نسختك من Gravity Forms لتتمكن من الوصول إلى الترقيات والدعم التلقائي. هل تحتاج إلى مفتاح ترخيص؟ %3$sقم بشراء واحد الآن%4$s. ','<a href="%1$s" class="update-link" aria-label="Update %2$s now">'=>'<a href="%1$s" class="update-link" aria-label="تحديث %2$s الآن">','There is a new version of %1$s available. %2$sView version %3$s details%4$s or %5$supdate now%6$s. '=>'هناك نسخة جديدة متاحة من %1$s. s%2$sعرض تفاصيل النسخة %3$s%4$s أو %5$sقم بالتحديث الآن%6$s. ','<a class="thickbox open-plugin-details-modal" aria-label="View %1$s version %2$s details" href="%3$s">'=>'<a class="thickbox open-plugin-details-modal" aria-label="عرض نسخة %1$s تفاصيل %2$s" href="%3$s">','There is a new version of %1$s available. %2$sView version %3$s details%4$s. '=>'هناك نسخة جديدة متاحة من %1$s. s%2$sعرض النسخة %3$s تفاصيل%4$s. ','This version of the %1$s is not compatible with the version of Gravity Forms that is installed. Upgrade this add-on to version %2$s or greater to avoid compatibility issues and potential loss of data.'=>'هذه النسخة من %1$s غير متوافقة مع نسخة Gravity Forms المنصبة. قم بترقية هذه الإضافة إلى نسخة %2$s أو نسخة أحدث لتجنب مشكلات التوافق واحتمال فقدان البيانات.','Please select a form'=>'من فضلك اختار نموذج','Add Form'=>'اضف نموذج','Add Gravity Form'=>'اضف نموذج','New Form'=>'استمارة جديدة','Update Available'=>'يوجد تحديث متاح','Upload folder is not writable. Export and file upload features will not be functional.'=>'مجلد الرفع غير قابل للكتابة. لن تعمل ميزات التصدير ورفع الملفات.','REST API Settings'=>'إعدادات واجهة برمجة تطبيقات(API) REST','Logging Settings'=>'إعدادات التسجيل','Uninstall Gravity Forms'=>'الغاء تثبيت النماذج','View System Status'=>'عرض حالة النظام','Manage Add-Ons'=>'إدارة الإضافات','Manage Updates'=>'إدارة التحديثات','Edit Plugin Settings'=>'تحرير إعدادات الإضافة','View Plugin Settings'=>'عرض إعدادات الإضافة','Edit Entry Notes'=>'تحرير ملاحظات الإدخال','View Entry Notes'=>'عرض ملاحظات الإدخال','Delete Entries'=>'حذف الإدخالات','Edit Entries'=>'تحرير الإدخالات','View Entries'=>'عرض الإدخالات','Preview Forms'=>'معاينة النماذج','Edit Forms'=>'تحرير النماذج','Delete Forms'=>'حذف النماذج','Create Forms'=>'أنشاء النماذج','Check this box to add a toggle allowing the user to see the password they are entering in.'=>'حدد هذا المربع لإضافة مفتاح تبديل يسمح للمستخدم برؤية كلمة المرور التي يدخلها.','Password Visibility Toggle'=>'تبديل رؤية كلمة المرور','Use these settings to keep entries only as long as they are needed. Trash or delete entries automatically older than the specified number of days. The minimum number of days allowed is one. This is to ensure that all entry processing is complete before deleting/trashing. The number of days setting is a minimum, not an exact period of time. The trashing/deleting occurs during the daily cron task so some entries may appear to remain up to a day longer than expected.'=>'استخدم هذه الإعدادات للاحتفاظ بالإدخالات فقط طالما هناك حاجة إليها. قم بحذف أو بإلقاء في سلة المهملات تلقائيًا الإدخالات التي تجاوزت عدد الأيام المحدد. الحد الأدنى لعدد الأيام المسموح بها هو يوم واحد. وذلك للتأكد من اكتمال معالجة الإدخال قبل الحذف/الإلقاء في سلة المهملات. إعداد عدد الأيام هو الحد الأدنى وليس بفترة زمنية محددة. تحدث عملية الحذف/الإلقاء في سلة المهملات أثناء مهمة cron اليومية، لذلك قد تبدو بعض الإدخالات وكأنها تبقى لمدة تصل إلى يوم وهي مدة أطول من المتوقع.','Check this box if you would like to prevent the IP address from being stored during form submission.'=>'حدد هذا المربع إذا كنت ترغب في منع تخزين عنوان IP أثناء إرسال النموذج.','Select the fields which will be included when exporting or erasing personal data.'=>'حدد الحقول التي سيتم تضمينها عند تصدير البيانات الشخصية أو مسحها.','Select the field which will be used to identify the owner of the personal data.'=>'حدد الحقل الذي سيتم استخدامه لتحديد مالك البيانات الشخصية.','Identification'=>'الهوية','Check this box if you would like to include data from this form when exporting or erasing personal data on this site.'=>'حدد هذا المربع إذا كنت ترغب في تضمين بيانات من هذا النموذج عند تصدير البيانات الشخصية أو مسحها على هذا الموقع.','Enable Personal Data Tools'=>'تمكين أدوات البيانات الشخصية','Check this box if you would like to use the rich text editor for this field.'=>'حدد هذا المربع إذا كنت ترغب في استخدام محرر النص المنسق لهذا الحقل.','Use Rich Text Editor'=>'استخدم محرر النص المنسق','Enter text to display at the top of the progress bar.'=>'أدخل النص لعرضه في أعلى شريط التقدم.','Progress Bar Completion Text'=>'نص إكمال شريط التقدم','Check this box if you would like the progress bar to display with the confirmation text.'=>'حدد هذا المربع إذا كنت ترغب في عرض شريط التقدم مع نص التأكيد.','Progress Bar Confirmation Display'=>'عرض تأكيد شريط التقدم','Enter a comma separated list of email addresses you would like to receive the selected notification emails.'=>'أدخل قائمة فاصلة بفواصل لعناوين البريد الإلكتروني التي ترغب في تلقي رسائل البريد الإلكتروني الخاصة بالإشعارات المحددة.','Override Notifications'=>'تجاوز الإشعارات','Tab Index Start Value'=>'قيمة بداية علامة تبويب الفهرس','Conversion is the percentage of form views that generated an entry. If a form was viewed twice, and one entry was generated, the conversion will be 50%.'=>'التحويل هو النسبة المئوية لمشاهدات النموذج التي أدت إلى إنشاء إدخال. إذا تم عرض النموذج مرتين وتم إنشاء إدخال واحد، فسيكون التحويل 50%.','Entries Conversion'=>'تحويل الإدخالات','Please select the currency for your location.  Currency is used for pricing fields and price calculations.'=>'يرجى تحديد العملة لموقعك. يتم استخدام العملة لحقول التسعير وحسابات الأسعار.','Select the type of reCAPTCHA you would like to use.'=>'حدد نوع reCAPTCHA الذي ترغب في استخدامه.','reCAPTCHA Type'=>'نوع reCAPTCHA','Enter your reCAPTCHA Secret Key, if you do not have a key you can register for one at the provided link.  reCAPTCHA is a free service.'=>'أدخل مفتاح reCAPTCHA السري الخاص بك. إذا لم يكن لديك مفتاح يمكنك التسجيل للحصول عليه على الرابط المقدم. reCAPTCHA هي خدمة مجانية.','reCAPTCHA Secret Key'=>'المفتاح السري لreCAPTCHA','Enter your reCAPTCHA Site Key, if you do not have a key you can register for one at the provided link.  reCAPTCHA is a free service.'=>'أدخل مفتاح موقع reCAPTCHA الخاص بك. إذا لم يكن لديك مفتاح يمكنك التسجيل للحصول عليه على الرابط المقدم. reCAPTCHA هي خدمة مجانية.','reCAPTCHA Site Key'=>'مفتاح موقع reCAPTCHA','Select On or Off to enable or disable no-conflict mode. Setting this to On will prevent extraneous scripts and styles from being printed on Gravity Forms admin pages, reducing conflicts with other plugins and themes.'=>'حدد تشغيل أو إيقاف التشغيل لتمكين وضع عدم التعارض أو تعطيله. سيؤدي ضبط هذا على تشغيل إلى منع طباعة البرامج النصية والأساليب الغير ضرورية على صفحات إدارة Gravity Forms، مما يقلل التعارضات مع الإضافات والقوالب الأخرى.','Select yes or no to enable or disable HTML5 output. Setting this to no will disable the standard Gravity Forms HTML5 form field output.'=>'حدد "نعم" أو "لا" لتمكين إخراج HTML5 أو تعطيله. سيؤدي تعيين هذا إلى "لا" إلى تعطيل إخراج حقل نموذج Gravity Forms HTML5 القياسي.','Select yes or no to enable or disable CSS output.  Setting this to no will disable the standard Gravity Forms CSS from being included in your theme.'=>'حدد "نعم" أو "لا" لتمكين أو تعطيل إخراج CSS. سيؤدي تعيين هذا إلى "لا" إلى تعطيل تضمين Gravity Forms CSS القياسي في القالب الخاص بك.','Your Gravity Forms support license key is used to verify your support package, enable automatic updates and receive support.'=>'يتم استخدام مفتاح ترخيص دعم Gravity Forms الخاص بك للتحقق من حزمة الدعم الخاصة بك وتمكين التحديثات التلقائية وتلقي الدعم.','Settings License Key'=>'إعدادات مفتاح الترخيص','Select a date range. Setting a range will limit the export to entries submitted during that date range. If no range is set, all entries will be exported.'=>'حدد نطاقًا تاريخيًا. سيؤدي تعيين نطاق إلى تقييد التصدير إلى الإدخالات المقدمة خلال هذا النطاق التاريخي. إذا لم يتم تعيين أي نطاق، فسيتم تصدير كافة الإدخالات.','Export Date Range'=>'تصدير نطاق التاريخ','Select the fields you would like to include in the export.'=>'حدد الحقول التي ترغب في تضمينها في التصدير.','Export Selected Fields'=>'تصدير الحقول المختارة','Filter the entries by adding conditions.'=>'تصفية الإدخالات عن طريق إضافة الشروط.','Select the forms you would like to export.'=>'حدد النماذج التي ترغب في تصديرها.','Export Selected Forms'=>'تصدير النموذج المختار','Select the form you would like to export entry data from. You may only export data from one form at a time.'=>'حدد النموذج الذي ترغب في تصدير بيانات الإدخال منه. لا يجوز لك سوى تصدير البيانات من نموذج واحد في كل مرة.','Export Selected Form'=>'تصدير النموذج المختار','Pricing fields allow you to add fields to your form that calculate pricing for selling goods and services.'=>'تتيح لك حقول التسعير إضافة حقول إلى النموذج الخاص بك لحساب أسعار بيع السلع والخدمات.','Post Fields allow you to add fields to your form that create Post Drafts in WordPress from the submitted data.'=>'تتيح لك حقول المقالة إضافة حقول إلى النموذج الخاص بك والتي تنشئ مسودات المقالة في ووردبريس من البيانات المقدمة.','Advanced Fields are for specific uses.  They enable advanced formatting of regularly used fields such as Name, Email, Address, etc.'=>'الحقول المتقدمة مخصصة لاستخدامات محددة. فهي تتيح التنسيق المتقدم للحقول المستخدمة بانتظام مثل الاسم والبريد الإلكتروني والعنوان وما إلى ذلك.','Standard Fields provide basic form functionality.'=>'توفر الحقول القياسية وظائف النموذج الأساسية.','Input masks provide a visual guide allowing users to more easily enter data in a specific format such as dates and phone numbers.'=>'توفر أقنعة الإدخال دليلاً مرئيًا يسمح للمستخدمين بإدخال البيانات بسهولة أكبر وبتنسيق معين مثل التواريخ وأرقام الهواتف.','Select which Product this field is tied to.'=>'حدد المنتج الذي يرتبط به هذا الحقل.','Product Field'=>'حقل المنتج','Disables the quantity field.  A quantity of 1 will be assumed or you can add a Quantity field to your form from the Pricing Fields.'=>'تعطيل حقل الكمية. سيتم افتراض كمية 1 أو يمكنك إضافة حقل الكمية إلى النموذج الخاص بك من حقول التسعير.','Disable Quantity'=>'تعطيل الكمية','Enter the base price for this product.'=>'أدخل السعر الأساسي لهذا المنتج.','Base Price'=>'السعر الأساسي','Enter the content (Text or HTML) to be displayed on the form.'=>'أدخل المحتوى (نص أو HTML) ليتم عرضه في النموذج.','Check this option to enable data to be passed to the form and pre-populate this field dynamically. Data can be passed via Query Strings, Shortcode and/or Hooks.'=>'حدد هذا الخيار لتمكين تمرير البيانات إلى النموذج وملء هذا الحقل مسبقًا ديناميكيًا. يمكن تمرير البيانات عبر سلاسل الاستعلام و/أو الكود القصير و/أو الخطافات.','Incoming Field Data'=>'البيانات الميدانية الواردة','Check this option to set this image as the post\'s Featured Image.'=>'حدد هذا الخيار لتعيين هذه الصورة كصورة بارزة للمقالة.','Select one or more image metadata field to be displayed along with the image upload field. They enable users to enter additional information about the uploaded image.'=>'حدد واحدًا أو أكثر من حقول البيانات التعريفية للصورة ليتم عرضها مع حقل رفع الصورة. أنهم يمكنون المستخدمين من إدخال معلومات إضافية حول الصورة التي تم رفعها.','Image Meta'=>'صورة ميتا','Selecting this option will set the post author to the WordPress user that submitted the form.'=>'سيؤدي تحديد هذا الخيار إلى تعيين كاتب المقالة إلى مستخدم ووردبريس الذي أرسل النموذج.','Use Current User as Author'=>'استخدم المستخدم الحالي ككاتب','Select the category that will be used for the post that is created by the form entry.'=>'حدد التصنيف التي سيتم استخدامه للمنشور الذي تم إنشاؤه بواسطة إدخال النموذج.','Check this option to format and insert merge tags into the Post Title.'=>'حدد هذا الخيار لصياغة وسوم الدمج وإدراجها في عنوان المقالة.','Post Title Template'=>'قالب عنوان المقالة','Check this option to format and insert merge tags into the Post Content.'=>'حدد هذا الخيار لصياغة وسوم الدمج وإدراجها في محتوى المقالة.','Post Content Template'=>'قالب محتوى المقالة','Select the post format that will be used for the post that is created by the form entry.'=>'حدد صيغة المقال التي سيتم استخدامها في المقالة التي تم إنشاؤها بواسطة إدخال النموذج.','Select the author that will be used for the post that is created by the form entry.'=>'حدد الكاتب الذي سيتم استخدامه في المقالة التي تم إنشاؤها بواسطة إدخال النموذج.','Post Author'=>'كاتب المقال','Select the post status that will be used for the post that is created by the form entry.'=>'حدد حالة المقالة التي سيتم استخدامها في المقالة التي تم إنشاؤها بواسطة إدخال النموذج.','Select which categories are displayed. You can choose to display all of them or select individual ones.'=>'حدد التصنيفات التي سيتم عرضها. يمكنك اختيار عرضها كليًا أو تحديد البعض منها بشكل فردي.','Create rules to dynamically display or hide the submit button based on values from another field.'=>'قم بإنشاء قواعد لعرض زر الإرسال أو إخفائه ديناميكيًا بناءً على قيم من حقل آخر.','Create rules to dynamically display or hide the page\'s Next Button based on values from another field.'=>'قم بإنشاء قواعد لعرض زر الصفحة التالية أو إخفائه ديناميكيًا بناءً على قيم من حقل آخر.','Next Button Conditional Logic'=>'المنطق الشرطي للزر التالي','Enter the path to an image you would like to use as the page previous button.'=>'أدخل المسار إلى الصورة التي ترغب في استخدامها كزر الصفحة السابقة.','Previous Button Image'=>'صورة الزر السابق','Enter the text you would like to appear on the page previous button.'=>'أدخل النص الذي ترغب في ظهوره على الزر الصفحة السابقة.','Previous Button Text'=>'نص الزر السابق','Enter the path to an image you would like to use as the page next button.'=>'أدخل المسار إلى الصورة التي ترغب في استخدامها كزر الصفحة التالية.','Next Button Image'=>'صورة الزر التالي','Enter the text you would like to appear on the page next button.'=>'أدخل النص الذي ترغب في ظهوره على الزر الصفحة التالية.','Next Button Text'=>'نص الزر التالي','Name each of the pages on your form.  Page names are displayed with the selected progress indicator.'=>'قم بتسمية كل صفحة من الصفحات في النموذج الخاص بك. يتم عرض أسماء الصفحات مع مؤشر التقدم المحدد.','Select which progress bar style you would like to use.  Select custom to choose your own text and background color.'=>'حدد تنسيق شريط التقدم الذي ترغب في استخدامه. حدد المخصص لاختيار النص ولون الخلفية الخاصين بك.','Select which type of visual progress indicator you would like to display.  Progress Bar, Steps or None.'=>'حدد نوع مؤشر التقدم المرئي الذي ترغب في عرضه. شريط التقدم أو الخطوات أو لا شيء.','Create rules to dynamically display or hide this page based on values from another field.'=>'قم بإنشاء قواعد لعرض هذه الصفحة أو إخفائها ديناميكيًا استنادًا إلى قيم من حقل آخر.','Page Conditional Logic'=>'المنطق الشرطي للصفحة','Enter a message to be displayed to users who are not logged in (shortcodes and HTML are supported).'=>'أدخل رسالة ليتم عرضها للمستخدمين الذين لم يقوموا بتسجيل الدخول (يتم دعم الأكواد القصيرة وHTML).','Check this option to require a user to be logged in to view this form.'=>'حدد هذا الخيار لمطالبة المستخدم بتسجيل الدخول لعرض هذا النموذج.','Check this option to add a text input as the final choice of your radio button field. This allows the user to specify a value that is not a predefined choice.'=>'حدد هذا الخيار لإضافة إدخال نص باعتباره الاختيار النهائي لحقل زر الاختيار الخاص بك. يتيح ذلك للمستخدم تحديد قيمة التي هي ليست خيارًا محددًا مسبقًا.','"Other" Choice'=>'خيار "آخر"','Check this option to add a "Select All" checkbox before the checkbox choices to allow users to check all the checkboxes with one click.'=>'حدد هذا الخيار لإضافة مربع اختيار "تحديد الكل" قبل اختيارات مربع الاختيار للسماح للمستخدمين بتحديد جميع مربعات الاختيار بنقرة واحدة.','"Select All" Choice'=>'خيار "تحديد الكل".','Text of the consent checkbox.'=>'نص مربع اختيار الموافقة.','Checkbox Text'=>'نص مربع الاختيار','By selecting this option, the %s jQuery script will be applied to this field, enabling search capabilities to Drop Down fields and a more user-friendly interface for Multi Select fields.'=>'من خلال تحديد هذا الخيار، سيتم تطبيق البرنامج النصي %s jQuery على هذا الحقل، مما يمكن صلاحيات البحث لمنسدلة الحقول والواجهة أكثر سهولة في الاستخدام لحقول التحديد المتعددة.','Enable Enhanced UI'=>'تفعيل واجهة المستخدم (UI) المحسنة','Create rules to dynamically display or hide this field based on values from another field.'=>'قم بإنشاء قواعد لعرض هذا الحقل أو إخفائه ديناميكيًا استنادًا إلى قيم من حقل آخر.','Check this option to specify a value for each choice. Choice values are not displayed to the user viewing the form, but are accessible to administrators when viewing the entry.'=>'حدد هذا الخيار لتحديد قيمة لكل اختيار. لا يتم عرض قيم الاختيار للمستخدم الذي يعرض النموذج، ولكن يمكن للمسؤولين الوصول إليها عند عرض الإدخال.','Enable Choice Values'=>'تفعيل قيم الاختيار','Define the choices for this field. If the field type supports it you will also be able to select the default choice(s) using a radio or checkbox located to the left of the choice.'=>'تحديد الاختيارات لهذا الحقل. إذا كان نوع الحقل يدعمه، فستتمكن أيضًا من تحديد الاختيار (الاختيارات) الافتراضية باستخدام الراديو أو مربع الاختيار الموجود على يسار الاختيار.','Field Choices'=>'خيارات الحقل','Enter the CSS class name you would like to use in order to override the default styles for this field.'=>'أدخل اسم فئة CSS الذي ترغب في استخدامه لتجاوز التنسيقات الافتراضية لهذا الحقل.','Select the language you would like to use for the reCAPTCHA display from the available options.'=>'حدد اللغة التي ترغب في استخدامها لعرض reCAPTCHA من الخيارات المتاحة.','reCAPTCHA Language'=>'لغة reCAPTCHA','If you would like to override the default error validation for a field, enter it here.  This message will be displayed if there is an error with this field when the user submits the form.'=>'إذا كنت ترغب في تجاوز التحقق من الخطأ الافتراضي لأحد الحقول، فأدخله هنا. سيتم عرض هذه الرسالة إذا كان هناك خطأ في هذا الحقل عندما يرسل المستخدم النموذج.','Validation Message'=>'رسالة التحقق','Select this setting to let browsers help a user fill in a field with autocomplete.  You can enter a single autocomplete attribute or multiple attributes separated with a space.  Learn more about autocomplete in the %s accessibility documentation %s.'=>'حدد هذا الإعداد للسماح للمتصفحات بمساعدة المستخدم في ملء الحقل بالإكمال التلقائي. يمكنك إدخال سمة واحدة بالإكمال التلقائي أو سمات متعددة مفصولة بمسافة. تعرف على المزيد حول الإكمال التلقائي في %s وثائق إمكانية الوصول %s.','Autocomplete Attribute'=>'سمة الإكمال التلقائي','Select this setting to display the option as activated by default when the form first loads.'=>'حدد هذا الإعداد لعرض الخيار كما هو مفعل افتراضيًا عند تحميل النموذج لأول مرة.','Activated by Default'=>'تم التنشيط بشكل افتراضي','Select the field to be used as the source for the values for this field.'=>'حدد الحقل الذي سيتم استخدامه كمصدر لقيم هذا الحقل.','Enter the label to be displayed next to the check box. For example, &quot;same as shipping address&quot;.'=>'أدخل التسمية التي سيتم عرضها بجوار مربع الاختيار. على سبيل المثال، "نفس عنوان الشحن".','Activate this option to allow users to skip this field and submit the values entered in the associated field. For example, this is useful for shipping and billing address fields.'=>'قم بتنشيط هذا الخيار للسماح للمستخدمين بتخطي هذا الحقل وإرسال القيم المدخلة في الحقل المرتبط. على سبيل المثال، يعد هذا مفيدًا لحقول عنوان الشحن والفوترة.','Use Values Submitted in a Different Field'=>'استخدم القيم المقدمة في حقل مختلف','Placeholders will not be submitted along with the form. Use Placeholders to give a hint at the expected value or format.'=>'لن يتم إرسال العناصر النائبة مع النموذج. استخدم العناصر النائبة لإعطاء تلميح حول القيمة أو الصيغة المتوقعة.','The Placeholder will not be submitted along with the form. Use the Placeholder to give a hint at the expected value or format.'=>'لن يتم إرسال العنصر النائب مع النموذج. استخدم العنصر النائب لإعطاء تلميح حول القيمة أو الصيغة المتوقعة.','If you would like to pre-populate the value of a field, enter it here.'=>'إذا كنت ترغب في تعبئة قيمة الحقل مسبقًا، فأدخلها هنا.','Select the fields you\'d like to use in this Address Field and customize the Sub-Labels by entering new ones.'=>'حدد الحقول التي ترغب في استخدامها في حقل العنوان هذا وقم بتخصيص التسميات الفرعية عن طريق إدخال تسميات جديدة.','Add Choices to this field. You can mark a choice as selected by default by using the radio buttons on the left.'=>'أضف اختيارات إلى هذا الحقل. يمكنك وضع علامة على الاختيار على أنه محدد افتراضيًا باستخدام أزرار التعيين الموجودة على اليسار.','Name Prefix Choices'=>'اختيارات بادئة الاسم','Select the fields you\'d like to use in this Name field and customize the Sub-Labels by entering new ones.'=>'حدد الحقول التي ترغب في استخدامها في حقل الاسم هذا وقم بتخصيص التسميات الفرعية عن طريق إدخال تسميات جديدة.','Select a form field size from the available options. This will set the width of the field. Please note: if using a paragraph field, the size applies only to the height of the field.'=>'حدد حجم حقل النموذج من الخيارات المتاحة. سيؤدي هذا إلى ضبط عرض الحقل. يرجى ملاحظة: إذا كنت تستخدم حقل فقرة، فإن الحجم ينطبق فقط على ارتفاع الحقل.','Select the sub-label placement.  Sub-labels can be placed above the field inputs or below the field inputs.'=>'حدد موضع التسمية الفرعية. يمكن وضع التصنيفات الفرعية أعلى مدخلات الحقل أو أسفل مدخلات الحقل.','Select the description placement.  Descriptions can be placed above the field inputs or below the field inputs.'=>'حدد موضع الوصف. يمكن وضع الأوصاف أعلى مدخلات الحقل أو أسفل مدخلات الحقل.','Select the label visibility for this field.  Labels can either inherit the form setting or be hidden.'=>'حدد رؤية التسمية لهذا الحقل. يمكن أن ترث التسميات إعداد النموذج أو تكون مخفية.','Label Visibility'=>'رؤية التسمية','Enter values in this setting to override the Sub-Label for each field.'=>'أدخل قيمًا في هذا الإعداد لتجاوز التسمية الفرعية لكل حقل.','Enter the admin label of the form field.  Entering a value in this field will override the Field Label when displayed in the Gravity Forms administration tool.'=>'أدخل تسمية المدير لحقل النموذج. سيؤدي إدخال قيمة في هذا الحقل إلى تجاوز تسمية الحقل عند عرضها في أداة إدارة Gravity Forms.','Admin Label'=>'تسمية المدير','Specify how many decimal places the number should be rounded to.'=>'حدد عدد المنازل العشرية التي يجب تقريب الرقم إليها.','Specify a mathematical formula. The result of this formula will be dynamically populated as the value for this field.'=>'تحديد صيغة رياضية. سيتم ملء نتيجة هذه الصيغة ديناميكيًا كقيمة لهذا الحقل.','Enabling calculations will allow the value of this field to be dynamically calculated based on a mathematical formula.'=>'سيؤدي تمكين العمليات الحسابية إلى السماح بحساب قيمة هذا الحقل ديناميكيًا استنادًا إلى صيغة رياضية.','Enter the minimum and maximum values for this form field.  This will require that the value entered by the user must fall within this range.'=>'أدخل الحد الأدنى والحد الأقصى للقيم في حقل النموذج هذا. وسيتطلب ذلك أن تقع القيمة التي أدخلها المستخدم ضمن هذا النطاق.','Number Range'=>'نطاق الأرقام','Select this option to hide the field label in the form.'=>'حدد هذا الخيار لإخفاء تسمية الحقل في النموذج.','Hide Field Label'=>'إخفاء تسمية الحقل','Select this option to limit user input to unique values only.  This will require that a value entered in a field does not currently exist in the entry database for that field.'=>'حدد هذا الخيار لتقييد إدخال المستخدم بالقيم الفريدة فقط. وسيتطلب هذا ألا تكون القيمة المدخلة في الحقل موجودة حاليًا في قاعدة بيانات الإدخال لهذا الحقل.','Select this option to make the form field required.  A required field will prevent the form from being submitted if it is not filled out or selected.'=>'حدد هذا الخيار لجعل حقل النموذج مطلوبًا. سيمنع الحقل المطلوب إرسال النموذج إذا لم يتم ملؤه أو تحديده.','Required Field'=>'حقل مطلوب','Enter the description for the form field.  This will be displayed to the user and provide some direction on how the field should be filled out or selected.'=>'أدخل الوصف لحقل النموذج. سيتم عرض هذا للمستخدم وسيقدم بعض التوجيهات حول كيفية ملء الحقل أو تحديده.','Field Description'=>'وصف الحقل','Select the format you would like to use for the phone input.  Available options are domestic US/CANADA style phone number and international long format phone number.'=>'حدد الصيغة التي ترغب في استخدامها لإدخال الهاتف. الخيارات المتاحة هي رقم هاتف محلي بتنسيق الولايات المتحدة/كندا ورقم هاتف دولي طويل الصيغة.','Phone Number Format'=>'صيغة رقم الهاتف','Specify the maximum file size in megabytes allowed for each of the files.'=>'حدد الحد الأقصى لحجم الملف بالميجابايت المسموح بها لكل ملف من الملفات.','Specify the maximum number of files that can be uploaded using this field. Leave blank for unlimited. Note that the actual number of files permitted may be limited by this server\'s specifications and configuration.'=>'حدد الحد الأقصى لعدد الملفات التي يمكن رفعها باستخدام هذا الحقل. اتركه فارغا لعدد غير محدود. لاحظ أن العدد الفعلي للملفات المسموح بها قد يكون محدودًا بمواصفات هذا الخادم وتكوينه.','Select this option to enable multiple files to be uploaded for this field.'=>'حدد هذا الخيار لتفعيل رفع ملفات متعددة لهذا الحقل.','Enter the allowed file extensions for file uploads.  This will limit the type of files a user may upload.'=>'أدخل امتدادات الملفات المسموح بها لعمليات رفع الملفات. سيؤدي هذا إلى تحديد نوع الملفات التي يمكن للمستخدم رفعها.','Allowed File Extensions'=>'ملحقات الملفات المسموح بها','Select the format you would like to use for the time field.  Available options are 12 hour (i.e. 8:30 pm) and 24 hour (i.e. 20:30).'=>'حدد الصيغة التي ترغب في استخدامها لحقل الوقت. الخيارات المتاحة هي 12 ساعة (أي 8:30 مساءً) و24 ساعة (أي 20:30).','Select the format you would like to use for the date input.'=>'حدد الصيغة التي ترغب في استخدامها لإدخال التاريخ.','Field Date Format'=>'صيغة تاريخ الحقل','Check this box to prevent this field from being displayed in a non-secure page (i.e. not https://). It will redirect the page to the same URL, but starting with https:// instead. This option requires a properly configured SSL certificate.'=>'حدد هذا المربع لمنع عرض هذا الحقل في صفحة غير آمنة (أي ليست https://). سيؤدي ذلك إلى إعادة توجيه الصفحة إلى نفس عنوان URL، ولكن بالبدء بـ https:// بدلاً من ذلك. يتطلب هذا الخيار شهادة SSL تم تكوينها بشكل صحيح.','Select the format of numbers that are allowed in this field. You have the option to use a comma or a dot as the decimal separator.'=>'حدد صيغة الأرقام المسموح بها في هذا الحقل. لديك خيار استخدام فاصلة أو نقطة كفاصل عشري.','Select the format you would like to use for the Name field.  There are 3 options, Normal which includes First and Last Name, Extended which adds Prefix and Suffix, or Simple which is a single input field.'=>'حدد الصيغة التي ترغب في استخدامها لحقل الاسم. هناك 3 خيارات، عادي والذي يتضمن الاسم واسم العائلة، أو موسع الذي يضيف بادئة ولاحقة، أو بسيط وهو حقل إدخال واحد.','Field Name Format'=>'صيغة اسم الحقل','Check this box to prevent the State/Province/Region from being displayed in the form.'=>'حدد هذا المربع لمنع عرض الولاية/المحافظة/المنطقة في النموذج.','Hide State/Province/Region'=>'إخفاء الولاية/المحافظة/المنطقة','Check this box to prevent Province field from being displayed in the form.'=>'حدد هذا المربع لمنع عرض حقل "المحافظة" في النموذج.','Hide Province Field'=>'إخفاء حقل المحافظة','Check this box to prevent the State field from being displayed in the form.'=>'حدد هذا المربع لمنع عرض حقل الحالة في النموذج.','Hide State Field'=>'إخفاء حقل الولاية','Check this box to prevent the extra address input (Address Line 2) from being displayed in the form.'=>'حدد هذا المربع لمنع عرض إدخال العنوان الإضافي (سطر العنوان 2) في النموذج.','Hide Address Line 2'=>'إخفاء عنوان السطر الثاني','For addresses that only apply to one country, you can choose to not display the country drop down. Entries will still be recorded with the selected country.'=>'بالنسبة للعناوين التي تنطبق على دولة واحدة فقط، يمكنك اختيار عدم عرض القائمة المنسدلة الخاصة بالبلد. سيتم الاستمرار في تسجيل الإدخالات مع البلد المحدد.','Hide Country'=>'اخفاء الدولة','Select the country you would like to be selected by default when the form gets displayed.'=>'حدد الدولة التي ترغب في تحديدها افتراضيًا عند عرض النموذج.','Select the province you would like to be selected by default when the form gets displayed.'=>'حدد المحافظة التي ترغب في تحديدها افتراضيًا عند عرض النموذج.','Default Province'=>'المحافظة الافتراضية','Select the state you would like to be selected by default when the form gets displayed.'=>'حدد الولاية التي ترغب في تحديدها افتراضيًا عند عرض النموذج.','Default State'=>'الحالة الافتراضية','Select the type of address you would like to use.'=>'حدد نوع العنوان الذي ترغب في استخدامه.','Select the type of inputs you would like to use for the date field. Date Picker will let users select a date from a calendar. Date Field will let users free type the date.'=>'حدد نوع المدخلات التي ترغب في استخدامها لحقل التاريخ. سيسمح منتقي التاريخ للمستخدمين بتحديد تاريخ من التقويم. سيسمح حقل التاريخ للمستخدمين بكتابة التاريخ مجانًا.','Enter the maximum number of rows that users are allowed to add.'=>'أدخل الحد الأقصى لعدد الصفوف التي يُسمح للمستخدمين بإضافتها.','Enter the maximum number of characters that this field is allowed to have.'=>'أدخل الحد الأقصى لعدد الأحرف المسموح به في هذا الحقل.','Select the type of field from the available form fields.'=>'حدد نوع الحقل من حقول النموذج المتاحة.','Field type'=>'نوع الحقل','Select the custom field name from available existing custom fields, or enter a new custom field name.'=>'حدد اسم الحقل المخصص من الحقول المخصصة الموجودة والمتوفرة، أو أدخل اسم حقل مخصصًا جديدًا.','Select the position of the badge containing the links to Google\'s privacy policy and terms.'=>'حدد موضع الشارة التي تحتوي على الروابط المؤدية إلى سياسة الخصوصية و بنود جوجل.','CAPTCHA Badge Position'=>'موضع شارة CAPTCHA','Select the type of CAPTCHA you would like to use.'=>'حدد نوع CAPTCHA الذي ترغب في استخدامه.','CAPTCHA Type'=>'نوع CAPTCHA','Select the visual theme for the reCAPTCHA field from the available options to better match your site design.'=>'حدد القالب المرئي لحقل reCAPTCHA من الخيارات المتاحة لتتناسب بشكل أفضل مع تصميم موقعك.','reCAPTCHA Theme'=>'قالب reCAPTCHA','When enabled, margins are added to properly align the HTML content with other form fields.'=>'عند التفعيل، تتم إضافة الهوامش لمحاذاة محتوى HTML بشكل صحيح مع حقول النموذج الأخرى.','Disable Default Margins'=>'تعطيل التباعد الافتراضي','Enter the label for this HTML block. It will help you identify your HTML blocks in the form editor, but it will not be displayed on the form.'=>'أدخل التسمية الخاصة بمكون HTML هذا. سيساعدك ذلك على تحديد مكوّنات HTML الخاصة بك في محرر النماذج، ولكن لن يتم عرضها في النموذج.','Enter the label of the form field.  This is the field title the user will see when filling out the form.'=>'ادخل عنوان حقل النموذج. هذا هو عنوان الحقل الذي سيراه المستخدم عند ملء النموذج.','To pass field data to the confirmation page, build a Query String using the \'Insert Merge Tag\' drop down. %s..more info on querystrings &raquo;%s'=>'لتمرير بيانات الحقل إلى صفحة التأكيد، أنشئ سلسلة استعلام باستخدام المنسدلة "إدراج وسمة دمج". %s..مزيد من المعلومات حول سلاسل الاستعلام &raquo;%s','Pass Data Via Query String'=>'تمرير البيانات عبر سلسلة الاستعلام','Enter the URL of the webpage you would like the user to be redirected to after they have submitted the form.'=>'أدخل عنوان URL لصفحة الويب التي تريد إعادة توجيه المستخدم إليها بعد إرسال النموذج.','Redirect Form to URL'=>'إعادة توجيه النموذج إلى URL','Select the page you would like the user to be redirected to after they have submitted the form.'=>'حدد الصفحة التي ترغب في إعادة توجيه المستخدم إليها بعد إرسال النموذج.','Redirect Form to Page'=>'إعادة توجيه النموذج إلى الصفحة','When enabled, auto-formatting will insert paragraph breaks automatically. Disable auto-formatting when using HTML to create the confirmation content.'=>'عند تمكينه، سيؤدي التنسيق التلقائي إلى إدراج فواصل الفقرات تلقائيًا. قم بتعطيل التنسيق التلقائي عند استخدام HTML لإنشاء محتوى التأكيد.','Enter the text you would like the user to see on the confirmation page of this form.'=>'أدخل النص الذي ترغب في أن يراه المستخدم في صفحة التأكيد الخاصة بهذا النموذج.','Confirmation Message Text'=>'نص رسالة التأكيد','Enter the URL of a custom image to replace the default \'delete item\' icon. A maximum size of 16px by 16px is recommended'=>'أدخل عنوان URL لصورة مخصصة لتحل محل أيقونة "حذف العنصر" الافتراضي. يوصى بأن يكون الحد الأقصى للحجم 16 بكسل × 16 بكسل','Enter the URL of a custom image to replace the default \'add item\' icon. A maximum size of 16px by 16px is recommended'=>'أدخل عنوان URL لصورة مخصصة لتحل محل أيقونة "إضافة العنصر" الافتراضي. يوصى بأن يكون الحد الأقصى للحجم 16 بكسل × 16 بكسل','Enter the CSS class name you would like to use in order to override the default styles for this form.'=>'أدخل اسم فئة CSS الذي ترغب في استخدامه لتجاوز التنسيقات الافتراضية لهذا النموذج.','Form CSS Class Name'=>'اسم فئة نموذج CSS','Enter the path to an image you would like to use as the form submit button.'=>'أدخل المسار إلى الصورة التي ترغب في استخدامها كزر إرسال النموذج.','Form Button Image'=>'صورة زر النموذج','Enter the text you would like to appear on the form submit button.'=>'أدخل النص الذي ترغب في ظهوره في زر إرسال النموذج.','Form Button Text'=>'نص الزر النموذج','Required Indicator'=>'المؤشر المطلوب','Select the default sub-label placement.  Sub-labels can be placed above the field inputs or below the field inputs. This setting can be overridden in the appearance settings for each field.'=>'حدد موضع التسمية الفرعية الافتراضي. يمكن وضع التسمية الفرعية أعلى مدخلات الحقل أو أسفل مدخلات الحقل. يمكن تجاوز هذا الإعداد في إعدادات المظهر لكل حقل.','Select the default description placement.  Descriptions can be placed above the field inputs or below the field inputs. This setting can be overridden in the appearance settings for each field.'=>'حدد موضع الوصف الافتراضي. يمكن وضع الأوصاف أعلى مدخلات الحقل أو أسفل مدخلات الحقل. يمكن تجاوز هذا الإعداد في إعدادات المظهر لكل حقل.','Select the default label placement.  Labels can be top aligned above a field, left aligned to the left of a field, or right aligned to the right of a field. This is a global label placement setting.'=>'حدد موضع التسمية الافتراضي. يمكن محاذاة التسميات من الأعلى فوق الحقل، أو المحاذاة إلى اليسار على يسار الحقل، أو المحاذاة إلى اليمين على يمين الحقل. هذا هو إعداد وضع التسمية العام.','Form Label Placement'=>'وضع تسمية النموذج','Enter a description for your form. This may be used for user instructions.'=>'أدخل وصفًا للنموذج الخاص بك. يمكن استخدام هذا لتعليمات المستخدم.','Enter the title of your form.'=>'أدخل عنوان النموذج الخاص بك.','Check this option to enable Gravity Forms\' legacy markup. This will hinder the accessibility of your form.'=>'حدد هذا الخيار لتمكين العلامات القديمة لـ Gravity Forms. سيؤدي هذا إلى إعاقة إمكانية الوصول إلى النموذج الخاص بك.','Legacy Markup'=>'العلامات القديمة','Check this option to enable a sliding animation when displaying/hiding conditional logic fields.'=>'حدد هذا الخيار لتفعيل التأثير الحركي المنزلق عند عرض/إخفاء الحقول المنطقية الشرطية.','Enable Animation'=>'تفعيل التأثير الحركي','Enables the honeypot spam protection technique, which is an alternative to the reCAPTCHA field.'=>'تفعيل تقنية الحماية من مصائد الروبوتات العشوائية والتي تعد بديلاً لحقل reCAPTCHA.','Enable Anti-spam honeypot'=>'تفعيل مصائد الروبوتات لمكافحة البريد المزعج','Schedule a time period the form is active.'=>'جدولة فترة زمنية يكون فيها النموذج نشطًا.','Enter a number in the input box below to limit the number of entries allowed for this form. The form will become inactive when that number is reached.'=>'أدخل رقمًا في مربع الإدخال أدناه لتحديد عدد الإدخالات المسموح بها لهذا النموذج. سيصبح النموذج غير نشط عند الوصول إلى هذا الرقم.','Limit Number of Entries'=>'الحد من عدد الإدخالات','Limit the number of entries a form can generate and/or schedule a time period the form is active.'=>'حدد عدد الإدخالات التي يمكن للنموذج إنشاؤها و/أو جدولة فترة زمنية يكون فيها النموذج نشطًا.','Limit Form Activity'=>'الحد من نشاط النموذج','When enabled, any files uploaded to File Upload fields will be attached to the notification email.'=>'عند التمكين، سيتم إرفاق أي ملف تم رفعه إلى حقول رفع الملفات برسالة إشعار عبر البريد الإلكتروني.','Enter a comma separated list of email addresses you would like to receive a BCC of the notification email.'=>'أدخل قائمة مفصولة بفواصل لعناوين البريد الإلكتروني التي ترغب في تلقي نسخة كربونية مخفية (BCC) من الإشعار عبر البريد الإلكتروني.','Blind Carbon Copy Addresses'=>'عناوين نسخة كربونية مخفية','Enter a comma separated list of email addresses you would like to receive a CC of the notification email.'=>'أدخل قائمة مفصولة بفواصل لعناوين البريد الإلكتروني التي ترغب في تلقي نسخة كربونية (CC) من الإشعار عبر البريد الإلكتروني.','Carbon Copy Addresses'=>'عناوين النسخة الكربونية','Enter the email address you would like to be used as the reply to address for the notification email.'=>'أدخل عنوان البريد الإلكتروني الذي ترغب في استخدامه كرد على عنوان البريد الإلكتروني للإشعار.','Enter the name you would like the notification email sent from, or select the name from available name fields.'=>'أدخل الاسم الذي ترغب في إرسال الإشعار عبر البريد الإلكتروني منه، أو حدد الاسم من حقول الأسماء المتاحة.','Enter an authorized email address you would like the notification email sent from. To avoid deliverability issues, always use your site domain in the from email.'=>'أدخل عنوان بريد إلكتروني مرخّص تريد أن يُرسل الإشعار عبره. لتجنب مشكلات إمكانية التسليم، استخدم دائمًا نطاق موقعك في البريد الإلكتروني.','From Email Address'=>'من البريد الالكترونى','Allows notification to be sent to different email addresses depending on values selected in the form.'=>'يسمح بإرسال الإشعارات إلى عناوين بريد إلكتروني مختلفة بناءً على القيم المحددة في النموذج.','Routing'=>'التوجيه','When enabled, auto-formatting will insert paragraph breaks automatically. Disable auto-formatting when using HTML to create email notification content.'=>'عند تفعيله، سيؤدي التنسيق التلقائي إلى إدراج فواصل الفقرات تلقائيًا. قم بتعطيل التنسيق التلقائي عند استخدام HTML لإنشاء محتوى إشعارات البريد الإلكتروني.','Disable Auto-Formatting'=>'تعط