.','The date the entry was created, in UTC.'=>'تاريخ إنشاء الإدخال بالتوقيت العالمي المنسق (UTC).','The Form ID for the entry.'=>'معرف النموذج للإدخال.','Unique identifier for the resource.'=>'المعرف الفريد للمورد.','Missing entry JSON'=>'إدخال JSON مفقود','The field values.'=>'قيم الحقل','The input values.'=>'قيم المدخلات','Form not found.'=>'النموذج غير موجود.','The Form object must be sent as a JSON string in the request body with the content-type header set to application/json.'=>'يجب إرسال موضوع النموذج كسلسلة JSON في نص الطلب مع تعيين ترويسة نوع المحتوى على application/json.','The form has already been deleted.'=>'تم حذف النموذج.','Invalid form id.'=>'معرف النموذج غير صالح.','The add-on the feed belongs to.'=>'الإضافة التي ينتمي إليها التدفق','The JSON string containing the feed meta.'=>'سلسلة JSON التي تحتوي على تدفق ميتا (meta).','The Form ID for the feed.'=>'معرف النموذج للتدفق.','Unique identifier for the feed.'=>'المعرف الفريد للتدفق.','Missing feed meta'=>'تدفق ميتا (meta) مفقود','Missing add-on slug'=>'إضافة إسم لطيف مفقودة','Missing feed JSON'=>'تدفق JSON مفقودة','Missing Key Value Pairs JSON'=>'أزواج المفاتيح الرئيسية المفقودة JSON','Entry updated successfully'=>'تم تحديث المدخلة بنجاح','Property values should be sent as an array'=>'يجب إرسال قيم الخاصية كتصفيف','No property values were found in the request body'=>'لم يتم العثور على قيم الخاصية في نص الطلب','You don\'t have any API keys. Let\'s go %1$screate one%2$s!'=>'ليس لديك أي مفاتيح API. هيا %1$sننشئ واحدًا%2$s!','Never Accessed'=>'لم يتم الوصول إليها مطلقًا','Last Access'=>'آخر وصول','Permissions'=>'صلاحيات','User'=>'المستخدم','Create A Form'=>'انشئ نموذجًا','Installation Complete'=>'إكمال التثبيت','Congratulations! Click the \'Create A Form\' button to get started.'=>'تهانينا! انقر فوق زر "إنشاء نموذج" للبدء.','Global Settings'=>'إعدادات عامة','Protect your form entries from spam using Akismet.'=>'قم بحماية إدخالات النموذج الخاصة بك من البريد المزعج باستخدام Akismet.','Akismet Integration'=>'تكامل Akismet','Set this to ON to display the Forms menu in the WordPress top toolbar. The Forms menu will display the latest ten forms recently opened in the form editor.'=>'اضبط هذا على "مفعّل" لعرض قائمة النماذج في شريط أدوات ووردبريس العلوي. ستَعرض قائمة النماذج أحدث عشرة نماذج تم فتحها مؤخرًا في محرر النماذج.','Toolbar Menu'=>'قائمة شريط الأدوات','Set this to ON to prevent extraneous scripts and styles from being printed on Gravity Forms admin pages, reducing conflicts with other plugins and themes.'=>'اضبط هذا على "مفعّل" لمنع طباعة النصوص والتنسيقات الدخيلة على صفحات إدارة Gravity Forms، مما يقلل التعارضات مع الإضافات والقوالب الأخرى.','Off'=>'إيقاف','On'=>'تشغيل','Select a Currency'=>'اختار العملة','Back'=>'عودة','Next'=>'التالي','Please accept the terms'=>'الرجاء الموافقه على الشروط','Invalid or Expired Key : Please make sure you have entered the correct value and that your key is not expired.'=>'مفتاح غير صالح أو منتهي الصلاحية: يرجى التأكد من إدخال القيمة الصحيحة و أن مفتاح الترخيص المدخل غير منتهي الصلاحية.','Please enter a valid license key.'=>'الرجاء إدخال مفتاح ترخيص صحيح','License Key'=>'مفتاح التفعيل','I understand the risks of not providing a valid license key.'=>'أدرك مخاطر عدم توفير مفتاح ترخيص صالح.','If you don\'t enter a valid license key, you will not be able to update Gravity Forms when important bug fixes and security enhancements are released. This can be a serious security risk for your site.'=>'إذا لم تقم بإدخال مفتاح ترخيص صالح، فلن تتمكن من تحديث Gravity Forms عند إصدار إصلاحات الأخطاء المهمة وتحسينات أمنية. يمكن أن يشكل هذا خطرًا أمنيًا جسيمًا على موقعك.','Enter your Gravity Forms License Key below.  Your key unlocks access to automatic updates, the add-on installer, and support.  You can find your key on the My Account page on the %sGravity Forms%s site.'=>'أدخل مفتاح ترخيص Gravity Forms أدناه. يَفتح مفتاحك إمكانية الوصول إلى التحديثات التلقائية ومثبت الإضافة والدعم. يمكنك العثور على المفتاح الخاص بك في صفحة الحساب الخاصة بي على موقع %sGravity Forms%s.','Disabled'=>'معطل','Please accept the terms.'=>'الرجاء الموافقه على الشروط.','Background Updates'=>'التحديثات في الخلفية','I understand and accept the risk of not enabling background updates.'=>'أنا أفهم وأقبل مخاطر عدم تمكين تحديثات الخلفية.','By disabling background updates your site may not get critical bug fixes and security enhancements. We only recommend doing this if you are experienced at managing a WordPress site and accept the risks involved in manually keeping your WordPress site updated.'=>'من خلال تعطيل تحديثات الخلفية، قد لا يحصل موقعك على إصلاحات الأخطاء وتحسينات الأمان الهامة. نوصي فقط بالقيام بذلك إذا كنت من ذوي الخبرة في إدارة موقع ووردبريس وتقبل المخاطر التي ينطوي عليها تحديث موقع ووردبريس الخاص بك يدويًا.','Are you sure?'=>'هل أنت متأكد؟','Turn off background updates'=>'قم بإيقاف تشغيل تحديثات الخلفية','Keep background updates enabled'=>'حافظ على تمكين التحديثات الخلفية','Updates will only be available if you have entered a valid License Key'=>'لن تكون التحديثات متاحة إلا إذا قمت بإدخال مفتاح ترخيص صالح','This feature is activated by default unless you opt to disable it below. We only recommend disabling background updates if you intend on managing updates manually.'=>'يتم تنشيط هذه الميزة افتراضيًا ما لم تختار تعطيلها أدناه. نوصي فقط بتعطيل تحديثات الخلفية إذا كنت تنوي إدارة التحديثات يدويًا.','Gravity Forms will download important bug fixes, security enhancements and plugin updates automatically. Updates are extremely important to the security of your WordPress site.'=>'ستقوم Gravity Forms بتنزيل إصلاحات الأخطاء المهمة وتحسينات الأمان وتحديثات الإضافة تلقائيًا. تعد التحديثات مهمة للغاية لأمن موقع ووردبريس الخاص بك.','Welcome to Gravity Forms'=>'مرحبًا بك في Gravity Forms','There was a problem while inserting the field values'=>'حدثت مشكلة أثناء إدراج قيم الحقول','There was a problem while inserting one of the input values for the entry'=>'حدثت مشكلة أثناء إدخال إحدى قيم الإدخال للإدخال','An error prevented the entry for this form submission being saved. Please contact support.'=>'حدث خطأ يمنع حفظ الإدخال الخاص بإرسال النموذج هذا. يرجى الاتصال بالدعم.','You don\'t have adequate permission to edit entries.'=>'ليس لديك الصلاحية الكافية لتحرير الإدخالات.','Every %d Minutes'=>'كل %d دقيقة','Inactive'=>'غير نشط','Active'=>'مفعل','feeds'=>'التدفقات','feed'=>'خلاصة Feed','Checkbox'=>'مربع اختيار','Select which actions should only occur after payment has been received.'=>'حدد الإجراءات التي يجب أن تتم فقط بعد استلام الدفع.','Post Payment Actions'=>'إجراءات ما بعد الدفع','Process %s feed only when payment is received.'=>'قم بمعالجة تدفق %s فقط عند استلام الدفعة.','Invalid value'=>'قيمة غير صالحة','To get started, please configure your %s.'=>'للبدء، يرجى تكوين %s الخاص بك.','You don\'t have any feeds configured. Let\'s go %screate one%s!'=>'لم يتم تكوين أي تدفق لديك. هيا بنا %sننشأ واحدًا%s!','\'Cancel\' to stop, \'OK\' to delete.'=>'\'إلغاء\' للإيقاف، \'موافق\' للحذف.','WARNING: You are about to delete this item.'=>'تحذير:سوف تقوم بحذف هذا العنصر','Duplicate'=>'استنساخ','Edit'=>'تعديل','Delete'=>'حذف','There was an error updating this feed. Please review all errors below and try again.'=>'حدث خطأ أثناء تحديث هذا التدفق. يرجى مراجعة جميع الأخطاء أدناه والمحاولة مرة أخرى.','Feed updated successfully.'=>'تم تحديث التدفق بنجاح.','You don\'t have sufficient permissions to update the form settings.'=>'ليس لديك الصلاحيات الكافية لتحديث إعدادات النموذج.','Feed Settings'=>'إعدادات التدفق','Unable to render feed settings.'=>'غير قادر على تقديم إعدادات التدفق.','%s Feeds'=>'التدفقات%s','Add New'=>'اضف جديد','Copy %d'=>'نسخة %d','Copy 1'=>'نسخة 1','You don\'t have adequate permission to uninstall this add-on: '=>'ليس لديك الإذن الكافي لإلغاء تثبيت هذه الإضافة: ','Warning! ALL %s settings will be deleted. This cannot be undone. \'OK\' to delete, \'Cancel\' to stop'=>'تحذير! سيتم حذف كافة إعدادات %s. لا يمكن التراجع عنه. \'موافق\' للحذف، \'إلغاء\' للإيقاف','%sThis operation deletes ALL %s settings%s. If you continue, you will NOT be able to retrieve these settings.'=>'%sتؤدي هذه العملية إلى حذف كافة %s الإعدادات %s. إذا واصلت، فلن تتمكن من استرداد هذه الإعدادات.','Uninstall Add-On'=>'إلغاء تثبيت الإضافة','Uninstall %s Add-On'=>'إلغاء تنصيب %s الإضافة','You don\'t have sufficient permissions to update the settings.'=>'ليس لديك الصلاحيات الكافية لتحديث الإعدادات.','Warning'=>'تحديث','Uninstall %s'=>'إلغاء تنصيب %s','%s has been successfully uninstalled. It can be re-activated from the %splugins page%s.'=>'%s تم ازالته بنجاح. يمكن اعاده التفعيل من %sصفحه الإضافات %s.','This add-on needs to be updated. Please contact the developer.'=>'هذه الإضافة تحتاج إلى تحديث. يرجى الاتصال بالمطور.','You don\'t have adequate permission to view this page'=>'ليس لديك الصلاحية الكافية لعرض هذه الصفحة.','Unable to render form settings.'=>'غير قادر على تقديم إعدادات النموذج.','Validation Error'=>'خطأ في التحقق','Add Custom Key'=>'أضف مفتاح مخصص','Please add a %s field to your form.'=>'الرجاء إضافة حقل %s إلى النموذج الخاص بك.','%s settings updated.'=>'تم تحديث إعدادات %s.','Field type \'%s\' has not been implemented'=>'لم يتم تنفيذ نوع الحقل \'%s\'','Field could not be rendered.'=>'لا يمكن تقديم الحقل.','%s Settings'=>'%s التعديلات','Gravity Forms Add-Ons'=>'إضافات Gravity Forms','Results Page'=>'صفحة النتائج','Add-On Settings'=>'إعدادات الإضافات','Add-On Page'=>'صفحة الإضافة','Uninstall'=>'الغاء التثبيت','GF Add-Ons'=>'إضافات GF','Please resolve the following issues to use %s:'=>'يرجى حل المشاكل التالية للاستخدام %s:','%s is not able to run because your WordPress environment has not met the minimum requirements.'=>'%s غير قادر على التشغيل لأن بيئة ووردبريس لم تف بالمتطلبات الدنيا.','Current WordPress version (%s) does not meet minimum WordPress version requirement (%s).'=>'نسخة ووردبريس الحالية (%s) لا تلبي الحد الأدنى من متطلبات نسخة ووردبريس (%s).','Required PHP function missing: %s'=>'دالة PHP المطلوبة مفقودة: %s','Required PHP extension "%s" does not meet minimum version requirement: %s.